import React from "react";

const about = () => {
    return (
      <div style={{ height: "100%", width: "100%", overflow: "hidden"}}>
      <div
      style={{
          height: "100%",
          
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          height: "100vh",
        }}
        >
        <h1>
            About Page
        </h1>
    </div>

        </div>
  );
};

export default about;
